// Parse command and extract style + dream content
const message = $input.first().json.message.text || '';

const STYLES = {
  'cinematic': 'Cinematic film style with professional cinematography, dramatic lighting, smooth camera movements',
  'ghibli': 'Studio Ghibli anime style with soft watercolor backgrounds, magical realism, warm colors, whimsical atmosphere',
  'surreal': 'Surrealist art style inspired by Dal√≠ and Magritte - impossible geometry, melting forms, dreamlike distortions',
  'vintage': 'Vintage 8mm film style with grain, light leaks, sepia tones, nostalgic imperfection',
  'horror': 'Dark horror style with high contrast shadows, unsettling angles, fog, tension-building atmosphere',
  'abstract': 'Abstract experimental style with geometric shapes, flowing colors, morphing forms',
  'watercolor': 'Soft watercolor painting style with bleeding colors, soft edges, pastel palette',
  'cyberpunk': 'Neon-lit cyberpunk style with electric blues/pinks, rain-slicked surfaces, futuristic urban aesthetics'
};

let style = 'cinematic';
let styleDescription = STYLES['cinematic'];
let dreamContent = message;

if (message.startsWith('/dream')) {
  const parts = message.replace('/dream', '').trim().split(' ');
  const potentialStyle = parts[0]?.toLowerCase();

  if (STYLES[potentialStyle]) {
    style = potentialStyle;
    styleDescription = STYLES[potentialStyle];
    dreamContent = parts.slice(1).join(' ');
  } else {
    dreamContent = parts.join(' ');
  }
}

const hasDreamContent = dreamContent && dreamContent.trim().length > 5;
const isStylesRequest = message.startsWith('/styles');

return {
  json: {
    originalMessage: message,
    style,
    styleDescription,
    dreamContent: dreamContent.trim(),
    hasDreamContent,
    isStylesRequest,
    chatId: $input.first().json.message.chat.id,
    userId: $input.first().json.message.from.id,
    username: $input.first().json.message.from.username || 'anonymous',
    timestamp: new Date().toISOString()
  }
};

const agentOutput = $input.first().json.output;
const prevData = $('Set API Configuration').first().json;

let parsed;
try {
  const clean = agentOutput.replace(/```json\n?/g, '').replace(/```\n?/g, '').trim();
  parsed = JSON.parse(clean);
} catch (e) {
  parsed = {
    videoPrompt: agentOutput,
    analysis: {
      theme: "Unknown",
      emotionalTone: "Mysterious",
      symbols: [{symbol: "Dream", interpretation: "Personal significance"}],
      possibleMeaning: "This dream reflects your subconscious thoughts.",
      dreamType: "Processing"
    }
  };
}

return {
  json: {
    ...prevData,
    videoPrompt: parsed.videoPrompt,
    analysis: parsed.analysis
  }
};

